import React from "react";
import './App.css';
import Home from './screens/Home';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";
import Login from './screens/Login';
import '../node_modules/bootstrap-dark-5/dist/css/bootstrap-dark.min.css';
import '../node_modules/bootstrap/dist/js/bootstrap.bundle';
import '../node_modules/bootstrap/dist/js/bootstrap.bundle.min.js';
import Signup from './screens/Signup.js';
import { CartProvider } from './components/ContextReducer.js';
import Cart from './screens/Cart.js';
import MyOrder from './screens/MyOrder.js';

function App() {
  const apiBaseUrl = process.env.REACT_APP_API_BASE_URL;

  console.log("API Base URL:", apiBaseUrl);

  return (
    <CartProvider>
      <Router>
        <div>
          <Routes>
            <Route exact path="/" element={<Home apiBaseUrl={apiBaseUrl} />} />
            <Route exact path="/cart" element={<Cart apiBaseUrl={apiBaseUrl} />} />
            <Route exact path="/login" element={<Login apiBaseUrl={apiBaseUrl} />} />
            <Route exact path='/createuser' element={<Signup apiBaseUrl={apiBaseUrl} />} />
            <Route exact path='/myOrder' element={<MyOrder apiBaseUrl={apiBaseUrl} />} />
          </Routes>
        </div>
      </Router>
    </CartProvider>
  );
}

export default App;
